import axios from "axios";

export const studentPayment = async paymentId => {
  const { data } = await axios.get(
    `http://0.0.0.0:8000/api/payments/${paymentId}`
  );
  return data;
};

async function countries() {
  const { data } = await axios.get(
    `http://0.0.0.0:8000/api/payments/${paymentId}`
  );
  return data;
}

async function cities() {
  const { data } = await axios.get(
    `http://0.0.0.0:8000/api/payments/${paymentId}`
  );
  return data;
}

async function payments() {
  const {data} = await axios.get("http://0.0.0.0:8000/api/payments/");
  return data;
}
